    _name: getSafePosition.GetSafePosition
    base_file: /src/controller_mission/state/getSafePosition.py
    is_root: true
    outcome_states: [succeeded, aborted]
    parameters:
    - !!python/object:rqt_mission_planner.mission_model.state.Parameter {description: state_name,
      value: GetSafePosition, variable_name: state_name}
