        is_root: false
        outcome_states: [succeeded, aborted]
        parameters:
        - !!python/object:rqt_mission_planner.mission_model.state.Parameter {description: state_name,
          value: GoToObjective, variable_name: state_name}
        - !!python/object:rqt_mission_planner.mission_model.state.Parameter {description: ' ''Aligned
            to object''', value: ' buoys', variable_name: param_go_to_object}
        transitions: []
      transitions: []
